import Item from './Item';

const TasksList = props => {
  return (
    <ul className="task-list">
      {Object.keys(props.items).map((key, index) => (
        <Item
          key={key}
          id={key}
          onDelete={props.onDeleteItem}
          onEdit={props.onEditItem}
          even={(index % 2) === 0}
        >
          {props.items[key].title}
        </Item>
      ))}
    </ul>
  );
};

export default TasksList;
